Adaptive Cards do not support changing the background color directly through the card's JSON schema. The background color is typically controlled by the host application (e.g., Microsoft Teams, Outlook, etc.) and is designed to maintain a consistent look and feel across different platforms.

However, you can influence the appearance of your Adaptive Card by using elements like `style` in containers or text blocks to apply some styling, but these are limited to predefined styles and do not include background color changes.

Here's an example of how you might use the `style` property in an Adaptive Card:

```json
{
  "type": "AdaptiveCard",
  "body": [
    {
      "type": "TextBlock",
      "size": "Medium",
      "weight": "Bolder",
      "text": "This is a text block with emphasis style"
    },
    {
      "type": "Container",
      "style": "emphasis",
      "items": [
        {
          "type": "TextBlock",
          "size": "Medium",
          "weight": "Bolder",
          "text": "This is a text block inside an emphasis container"
        }
      ]
    }
  ],
  "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
  "version": "1.3"
}
```

In this example, the `style` property is set to `"emphasis"`, which applies a predefined style to the container.

If you need more control over the appearance, including background colors, you might need to consider using a different approach, such as custom HTML rendering within a web chat interface, where you have more control over the styling. However, this would not be applicable to Adaptive Cards used in platforms like Microsoft Teams or Outlook.

